import React from 'react';
import './ClienteTile.css';

export const ClienteTile = ({ cliente, onClick }) => {
  return (
    <div className="tile" onClick={onClick}>
      <div className="tile-image-container">
        <img src={cliente.profile_image || '../../img/no_photo_arsheep.png'} alt={`Imagen de ${cliente.nombre_cliente}`} />
      </div>
      <div className="tile-content">
        <p>{cliente.nombre_cliente}</p>
        <p>{cliente.numrun_cliente}</p>
      </div>
    </div>
  );
};

export default ClienteTile;
